// Solution 1:
function moveElementToEnd(array, toMove) {
    let left = 0;
    let right = array.length - 1;

    while (left < right) {
        if (array[right] === toMove && array[left]!== toMove) {
            [array[left], array[right]] = [array[right], array[left]];
            left++;
            right--;
        } else if (array[right]!== toMove) {
            right--;
        } else if (array[left] === toMove) {
            right--;
        } else {
            left++;
        }
    }

    return array;
}

